import React, { useState } from 'react';

// Map token names to real TradingView symbols (for demo)
const symbolMap = {
  PAWPAW: 'SOLUSDT',
  'BABY BOB': 'BTCUSDT',
  RUGPULL: 'ETHUSDT',
};

// Mock token data
const tokenList = [
  {
    name: 'PAWPAW',
    emoji: 'üê∂',
    volumeSpike: 115,
    risk: 'Low',
    meta: 'GambleFi',
    roi: 24.4,
    price: '$0.123',
    cap: '$1.2M',
    strategy: 'Smart Whale + GambleFi',
    winRate: 68,
  },
  {
    name: 'BABY BOB',
    emoji: 'üê∏',
    volumeSpike: 134,
    risk: 'Low',
    meta: 'GambleFi',
    roi: 34.1,
    price: '$0.089',
    cap: '$0.8M',
    strategy: 'Volume Spike + Meme',
    winRate: 72,
  },
  {
    name: 'RUGPULL',
    emoji: 'üí©',
    volumeSpike: 210,
    risk: 'High',
    meta: 'Meme',
    roi: -12.5,
    price: '$0.002',
    cap: '$0.1M',
    strategy: 'High Risk + Meme',
    winRate: 12,
  },
];

function TradingViewWidget({ symbol }) {
  return (
    <iframe
      title="TradingView Chart"
      src={`https://www.tradingview.com/widgetembed/?symbol=${symbol || 'SOLUSDT'}&interval=5&hidesidetoolbar=1&theme=dark&style=1&timezone=Etc/UTC&withdateranges=1&hideideas=1&studies=[]&saveimage=0&toolbarbg=f1f3f6&studies_overrides={}`}
      style={{ width: '100%', height: 300, border: 'none', borderRadius: 12 }}
      allowFullScreen
    />
  );
}

export default function DashboardTab() {
  const [selectedToken, setSelectedToken] = useState(null);
  const [amount, setAmount] = useState('0.01 SOL');
  const [orderType, setOrderType] = useState('Market');

  return (
    <div className="grid grid-cols-3 gap-6 px-6 py-4 bg-black min-h-screen text-white font-sans">
      {/* Left ‚Äì Token Feed */}
      <div className="space-y-4">
        <h2 className="text-xl font-semibold mb-2">Pinged Tokens</h2>
        {tokenList.map((t) => (
          <div
            key={t.name}
            className={`bg-[#1A1A1A] p-4 rounded-lg border ${selectedToken?.name === t.name ? 'border-indigo-500 ring-2 ring-indigo-400 scale-[1.02]' : 'border-white/10'} hover:shadow-lg hover:border-indigo-400 transition-all cursor-pointer group`}
            onClick={() => setSelectedToken(t)}
          >
            <div className="flex justify-between items-center">
              <div className="font-bold text-white flex items-center gap-2 text-lg">
                <span className="text-2xl">{t.emoji}</span>${t.name}
              </div>
              <span className={`text-xs px-2 py-1 rounded-md ${t.risk === 'High' ? 'bg-red-500/20 text-red-400' : 'bg-green-500/20 text-green-300'}`}>{t.risk}</span>
            </div>
            <div className="text-sm text-white/60 mt-1">Vol: {t.volumeSpike}%</div>
            <div className="text-sm text-white/60">Meta: {t.meta}</div>
            <div className="text-xs mt-2 text-indigo-400">Strategy: {t.strategy}</div>
            {/* Sparkline placeholder */}
            <div className="h-4 mt-2 mb-1 flex items-center">
              <div className="w-20 h-2 bg-gradient-to-r from-green-400 via-yellow-300 to-red-400 rounded-full opacity-60" />
              <span className="ml-2 text-xs text-white/40">{t.winRate}% win</span>
            </div>
            <div className={`text-right font-semibold mt-1 ${t.roi > 0 ? 'text-green-400' : 'text-red-400'}`}>{t.roi > 0 ? '+' : ''}{t.roi}%</div>
          </div>
        ))}
      </div>

      {/* Center ‚Äì Live Chart */}
      <div className="flex flex-col h-full">
        <div className="bg-neutral-900 rounded-xl p-6 shadow-md border border-white/10 h-full flex flex-col">
          <h2 className="text-center text-lg font-semibold mb-2">Live Chart</h2>
          <div className="flex-1 bg-gradient-to-br from-[#101828] to-[#1f2937] rounded-xl p-4 flex items-center justify-center">
            <TradingViewWidget symbol={symbolMap[selectedToken?.name] || 'SOLUSDT'} />
          </div>
        </div>
      </div>

      {/* Right ‚Äì Trade Panel */}
      <div className="flex flex-col h-full">
        <div className="bg-neutral-900 rounded-xl p-6 shadow-md border border-white/10 h-full flex flex-col">
          <h2 className="text-lg font-semibold mb-4">Trading Terminal</h2>
          {selectedToken ? (
            <>
              <div className="text-white mb-2">Token: ${selectedToken.name}</div>
              <div className="text-sm text-white/60 mb-4">
                Price: {selectedToken.price} | Cap: {selectedToken.cap} | Strategy: {selectedToken.strategy}
              </div>
              <div className="mb-4">
                <label className="block text-sm mb-1">Amount</label>
                <select
                  className="bg-black border border-white/10 rounded-md px-2 py-1 text-white w-full mb-2"
                  value={amount}
                  onChange={e => setAmount(e.target.value)}
                >
                  <option>0.01 SOL</option>
                  <option>0.1 SOL</option>
                  <option>1 SOL</option>
                </select>
                <div className="flex gap-2 mb-2">
                  <button
                    className={`flex-1 py-1 rounded-md text-sm font-semibold border ${orderType === 'Market' ? 'bg-green-600 text-white border-green-700' : 'bg-black text-white/60 border-white/10'} transition`}
                    onClick={() => setOrderType('Market')}
                  >Market</button>
                  <button
                    className={`flex-1 py-1 rounded-md text-sm font-semibold border ${orderType === 'Limit' ? 'bg-blue-600 text-white border-blue-700' : 'bg-black text-white/60 border-white/10'} transition`}
                    onClick={() => setOrderType('Limit')}
                  >Limit</button>
                </div>
                <div className="text-xs text-white/50 mt-2">Slippage: 0.5%</div>
              </div>
              <div className="space-y-3">
                <button className="w-full py-2 rounded-md bg-green-600 hover:bg-green-500 transition">Buy Chill</button>
                <button className="w-full py-2 rounded-md bg-red-600 hover:bg-red-500 transition">Sell Fast</button>
              </div>
              <div className="mt-4 text-xs text-white/50">Tx Status: <span className="text-green-400">Ready</span></div>
            </>
          ) : (
            <div className="text-white/40">Select a token to trade</div>
          )}
        </div>
      </div>
    </div>
  );
}
